import Reacgt, {Component} from 'react';
import './App.css';

import Card from './components/card/Card';
import Button from './components/button/Button';

const list = [
  {
    id: 0,
    src: 'https://i.ytimg.com/vi/PB5FosTwM8s/maxresdefault.jpg',
    text: 'Button 1'
  },
  {
    id: 1,
    src: '',
    text: 'Button 2'
  },
  {
    id: 2,
    src: '',
    text: 'Button 3'
  },
  {
    id: 3,
    src: '',
    text: 'Button 4'
  }
];

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {list: list};
  }
  render() {
    return (
      <div className="App ">
        <header className="App-header">
        { this.state.list.map(item => 
              <Card item={item}/>
        )}
        </header>
      </div>
    );
  }
}

export default App;
